const Nav = () => {
    return (
            <div className="navbar">
                <h1>Study Helper</h1>
                <div className="links">
                    <a href="#"> sem 1</a>
                    <a href="#">sem 2</a>
                    <a href="mailto:testing@gmail.com"></a>
                </div>
            </div>
    )
}

export default Nav;
